<!DOCTYPE html>
<html>
  <head>
    <title>Home</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <link href="resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>
    <link href="resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="data/styles.css" type="text/css" rel="stylesheet"/>
    <link href="files/home/styles.css" type="text/css" rel="stylesheet"/>
    <script src="resources/scripts/jquery-1.7.1.min.js"></script>
    <script src="resources/scripts/jquery-ui-1.8.10.custom.min.js"></script>
    <script src="resources/scripts/prototypePre.js"></script>
    <script src="data/document.js"></script>
    <script src="resources/scripts/prototypePost.js"></script>
    <script src="files/home/data.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- 首页 (Dynamic Panel) -->
      <div id="u6" class="ax_default" data-label="首页">
        <div id="u6_state0" class="panel_state" data-label="ViewPort" style="">
          <div id="u6_state0_content" class="panel_state_content">

            <!-- Android bottom virtual key (Dynamic Panel) -->
            <div id="u7" class="ax_default" data-label="Android bottom virtual key">
              <div id="u7_state0" class="panel_state" data-label="White Icons" style="">
                <div id="u7_state0_content" class="panel_state_content">

                  <!-- BG (Rectangle) -->
                  <div id="u8" class="ax_default shape1" data-label="BG">
                    <div id="u8_div" class=""></div>
                  </div>

                  <!-- Back (Image) -->
                  <div id="u9" class="ax_default image1" data-label="Back">
                    <img id="u9_img" class="img " src="images/home/back_u9.png"/>
                  </div>

                  <!-- Home (Image) -->
                  <div id="u10" class="ax_default image1" data-label="Home">
                    <img id="u10_img" class="img " src="images/home/home_u10.png"/>
                  </div>

                  <!-- Recent (Image) -->
                  <div id="u11" class="ax_default image1" data-label="Recent">
                    <img id="u11_img" class="img " src="images/home/recent_u11.png"/>
                  </div>
                </div>
              </div>
              <div id="u7_state1" class="panel_state" data-label="Grey Icons" style="visibility: hidden;">
                <div id="u7_state1_content" class="panel_state_content">

                  <!-- BG (Rectangle) -->
                  <div id="u12" class="ax_default shape1" data-label="BG">
                    <div id="u12_div" class=""></div>
                  </div>

                  <!-- Back (Image) -->
                  <div id="u13" class="ax_default image1" data-label="Back">
                    <img id="u13_img" class="img " src="images/home/back_u13.png"/>
                  </div>

                  <!-- Home (Image) -->
                  <div id="u14" class="ax_default image1" data-label="Home">
                    <img id="u14_img" class="img " src="images/home/home_u14.png"/>
                  </div>

                  <!-- Recent (Image) -->
                  <div id="u15" class="ax_default image1" data-label="Recent">
                    <img id="u15_img" class="img " src="images/home/recent_u15.png"/>
                  </div>
                </div>
              </div>
            </div>

            <!-- Unnamed (Status Bar) -->

            <!-- Status Bar (Dynamic Panel) -->
            <div id="u17" class="ax_default" data-label="Status Bar">
              <div id="u17_state0" class="panel_state" data-label="Status Bar" style="">
                <div id="u17_state0_content" class="panel_state_content">

                  <!-- Status BG Color (Rectangle) -->
                  <div id="u18" class="ax_default shape" data-label="Status BG Color">
                    <img id="u18_img" class="img " src="images/home/status_bg_color_u18.png"/>
                  </div>

                  <!-- Time (Rectangle) -->
                  <div id="u19" class="ax_default heading_1" data-label="Time">
                    <div id="u19_div" class=""></div>
                    <div id="u19_text" class="text ">
                      <p><span style="font-family:'Roboto Bold', 'Roboto';font-weight:700;">1:45</span></p>
                    </div>
                  </div>

                  <!-- Status Battery Icon (Image) -->
                  <div id="u20" class="ax_default image" data-label="Status Battery Icon">
                    <img id="u20_img" class="img " src="images/home/status_battery_icon_u20.png"/>
                  </div>

                  <!-- Status Wifi Icon (Image) -->
                  <div id="u21" class="ax_default image" data-label="Status Wifi Icon">
                    <img id="u21_img" class="img " src="images/home/status_wifi_icon_u21.png"/>
                  </div>

                  <!-- Status Network Icon (Image) -->
                  <div id="u22" class="ax_default image" data-label="Status Network Icon">
                    <img id="u22_img" class="img " src="images/home/status_network_icon_u22.png"/>
                  </div>

                  <!-- Time (Rectangle) -->
                  <div id="u23" class="ax_default heading_1" data-label="Time">
                    <div id="u23_div" class=""></div>
                    <div id="u23_text" class="text ">
                      <p><span style="font-family:'Roboto Bold', 'Roboto';font-weight:700;">1:45</span></p>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      <!-- Unnamed (Inline Frame) -->
      <div id="u24" class="ax_default">
        <iframe id="u24_input" scrolling="no" frameborder="1" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>
      </div>
    </div>
  </body>
</html>
